          ],
          "section": [
            {
              "title": "B. Package Leaflet",
              "code": {
                "coding": [
                  {
                    "system": "https://spor.ema.europa.eu/",
                    "code": "100000155538"
                  }
                ],
                "text": "B. PACKAGE LEAFLET"
              },
              "text": {
                "status": "additional",
                "div": "<div xmlns=\"http://www.w3.org/1999/xhtml\">PACKAGE LEAFLET: INFORMATION FOR THE USER Humalog Mix50 100 units/ml suspension for injection in cartridge insulin lispro Read all of this leaflet carefully before you start taking this medicine because it contains important information for you.<ul><li>Keep this leaflet. You may need to read it again.</li><li>If you have any further questions, ask your doctor or pharmacist.</li><li>This medicine has been prescribed for you only. Do not pass it on to others. It may harm them, even if their signs of illness are the same as yours.</li><li>If you get any side effects talk to your doctor or pharmacist. This includes any possible side effects not listed in this leaflet. See section 4.</li></ul></div>"
              }
            },
            {
              "title": "What is in this leaflet",
              "code": {
                "coding": [
                  {
                    "system": "https://spor.ema.europa.eu/",
                    "code": "100000155538-0"
                  }
                ],
                "text": "B. PACKAGE LEAFLET"
              },
              "text": {
                "status": "additional",
                "div": "<div xmlns=\"http://www.w3.org/1999/xhtml\">What in this leaflet<ol><li>What Humalog Mix50 is and what it is used for</li><li>What you need to know before you take Humalog Mix50</li><li>How to take Humalog Mix50</li><li>Possible side effects</li><li>How to store Humalog Mix50</li><li>Contents of the pack and other information</li></ol></div>"
              }
            },
            {
              "title": "1. What Humalog Mix50 is and what it is used for",
              "code": {
                "coding": [
                  {
                    "system": "https://spor.ema.europa.eu/",
                    "code": "100000155538-1"
                  }
                ],
                "text": "B. PACKAGE LEAFLET"
              },
              "text": {
                "status": "additional",
                "div": "<div xmlns=\"http://www.w3.org/1999/xhtml\"><b>1. What Humalog Mix50 is and what it is used for</b> Humalog Mix50 is used to treat diabetes. Humalog Mix50 is a premixed suspension. Its active substance is insulin lispro.</div>"
              }
            },
            {
              "title": "2. What you need to know before you use Humalog Mix50",
              "code": {
                "coding": [
                  {
                    "system": "https://spor.ema.europa.eu/",
                    "code": "100000155538-2"
                  }
                ],
                "text": "B. PACKAGE LEAFLET"
              },
              "text": {
                "status": "additional",
                "div": "<div xmlns=\"http://www.w3.org/1999/xhtml\"><b>2. What you need to know before you use Humalog Mix50</b> Do NOT use Humalog Mix50 if you</div>"
              }
            },
            {
              "title": "3. How to use Humalog Mix50",
              "code": {
                "coding": [
                  {
                    "system": "https://spor.ema.europa.eu/",
                    "code": "100000155538-3"
                  }
                ],
                "text": "B. PACKAGE LEAFLET"
              },
              "text": {
                "status": "additional",
                "div": "<div xmlns=\"http://www.w3.org/1999/xhtml\"><b>3. How to use Humalog Mix50</b> <b>The 3 ml cartridge is only for use in Lilly 3 ml pens. It is not for use in 1.5 ml pens.</b><p>Always use Humalog Mix50 exactly as your doctor has told you. You should check with your doctor if you are not sure. To prevent the possible transmission of disease, each cartridge must be used by you only, even if the needle on the delivery device is changed.</p></div>"
              }
            },
            {
              "title": "4. Possible side effects",
              "code": {
                "coding": [
                  {
                    "system": "https://spor.ema.europa.eu/",
                    "code": "100000155538-4"
                  }
                ],
                "text": "B. PACKAGE LEAFLET"
              },
              "text": {
                "status": "additional",
                "div": "<div xmlns=\"http://www.w3.org/1999/xhtml\"><p><b>4. Possible side effects</b></p><p>Like all medicines, this medicine can cause side effects, although not everybody gets them.</p></div>"
              }
            },
            {
              "title": "5. How to store Humalog Mix50",
              "code": {
                "coding": [
                  {
                    "system": "https://spor.ema.europa.eu/",
                    "code": "100000155538-5"
                  }
                ],
                "text": "B. PACKAGE LEAFLET"
              },
              "text": {
                "status": "additional",
                "div": "<div xmlns=\"http://www.w3.org/1999/xhtml\"><b>5. How to store Humalog Mix50</b><p>Before the first use store your Humalog Mix50 in a refrigerator (2C  8C). Do not freeze.</p><p>Keep your cartridge in use at room temperature (below 30C) and discard after 28 days. Do not put it near heat or in the sun. Do not keep your pen or the cartridges you are using in the fridge. The pen with the inserted cartridge should not be stored with the needle attached.</p><p>Keep out of the sight and reach of children. Do not use this medicine after the expiry date which is stated on the label and the carton. The expiry date refers to the last day of that month.</p><p>Do not use this medicine if you notice clumps of material are present or if solid white particles stick to the bottom or wall of the cartridge, giving it a frosted appearance. Check each time you inject yourself. Medicines should not be disposed of via wastewater or household waste. Ask your pharmacist how to dispose of medicines no longer required. These measures will help to protect the environment.</p></div>"
              }
            },
            {
              "title": "6. Contents of the pack and other information",
              "code": {
                "coding": [
                  {
                    "system": "https://spor.ema.europa.eu/",
                    "code": "100000155538-6"
                  }
                ],
                "text": "B. PACKAGE LEAFLET"
              },
              "text": {
                "status": "additional",
                "div": "<div xmlns=\"http://www.w3.org/1999/xhtml\"><b>6. Contents of the pack and other information</b> <b>What Humalog Mix50 100 units/ml suspension for injection in cartridge contains</b><p>The active substance is insulin lispro. Insulin lispro is made in the laboratory by a recombinant DNA technology process. It is a changed form of human insulin and so is different from other human and animal insulins. Insulin lispro is closely related to human insulin which is a natural hormone made by the pancreas. The other ingredients are protamine sulphate, m-cresol, phenol, glycerol, dibasic sodium phosphate 7H2O, zinc oxide and water for injection. Sodium hydroxide or hydrochloric acid may have been used to adjust the acidity.</p></div>"
              }
            }
          ]
